import React from "react";
import logo from "./logos/logo.png";
import RecycleBin from "./Recyclebin";

const Header = () => {

    const bin =() =>{
        console.log("Moved to bin")
       };
    

    return <>

        <div className="header">
            <img src={logo} alt="Logo" width="120px"/>
            <button> {bin} </button>
        </div>

    </>

};
 
export default Header;
